import React from "react";

export const AddTodoForm = ({ onAddTodoSubmit, onAddTodoInput }) => (
  <form onSubmit={onAddTodoSubmit}>
    <label htmlFor="addForm">Add your work:</label>
    &nbsp;
    <input id="addForm" type="text" onChange={onAddTodoInput} autoFocus />
    <button type="submit">Add</button>
  </form>
);
